import Image from 'material-ui-image';

class ProfileImage extends Component {
    render() {
        return (
            <div>
                <Image src="https://scontent-sjc3-1.xx.fbcdn.net/v/t1.0-9/60142836_2505010072843974_3190996422723895296_n.jpg?_nc_cat=104&_nc_oc=AQksWzlV5fecPc7EoBvwDqnrKLQEVT9_aVaOQV-llt3L0MMMFY1fgcxHyVkBdYlfKiLBowU5krLL_iQoJDJvFX4v&_nc_ht=scontent-sjc3-1.xx&oh=75e8b9197ac48a66b6df1d9f6bf1a5f8&oe=5D99CF8C" />
            </div>
        )
    }
}

export default ProfileImage;
